//NAVBAR INDEX.JS
import React from "react";
import Navbar from 'react-bootstrap/Navbar'
import { Jumbotron } from "react-bootstrap";

function HelloNavbar() {
    console.log("Engaging navbar index.js...");
    return (
        <div>
            <Navbar className="navbar" bg="dark" expand="lg">
            <Navbar.brand className="brand">Clickamajiggy</Navbar.brand>
            <div>
            <h3 className="center">Click an image to begin</h3>
            </div>
            <div>
            <h2 className="right">Score: 0 | Top Score: 0</h2>
            </div>
            </Navbar>

        <Jumbotron>
        </Jumbotron>
        </div>
    )
}

export default HelloNavbar;
